sys_variable_value.value:
(function execute(inputs, outputs) {

  //We loop every 1 minute, or 60000 milliseconds. queue_percent is a string where "50" -> "50%", e.g. 50% of 1 minute is 30000 milliseconds
  //GlideDuration() initializes by milliseconds.
  var queue_percent_scalar = parseInt(inputs.queue_percent) / 100
  var milliseconds_to_run = 60000 * queue_percent_scalar
  var queue_duration = new GlideDuration(milliseconds_to_run)

  //Elapsed time is a GlideDuration() object
  var start_time = new GlideDateTime(inputs.queue_start_time)
  var elapsed_time = GlideDateTime.subtract(start_time,new GlideDateTime())

  //outputs.debug_elapsed_time = "" + queue_duration + " " + elapsed_time + " " + milliseconds_to_run + " " + queue_percent_scalar

  //Final condition: elapsed_time has exceeded the allowed queue_duration
  if (elapsed_time > queue_duration) { outputs.keep_processing = false }
  else { outputs.keep_processing = true }
})(inputs, outputs);

